import React from 'react';
import classes from './TopBar.module.css'

const TopBar = () => {
    return(
        <nav className={classes.TopBar}>
        <img src="https://i.dlpng.com/static/png/197684_preview.png" alt="Amazon Logo"/>

        
      </nav>


    );
}
export default TopBar;
